/* Function  structure for function  `Distance` */

/*!50003 DROP FUNCTION IF EXISTS `Distance` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`db_user`@`%` FUNCTION `Distance`($coord1 VARCHAR(30), $coord2 VARCHAR(30)) RETURNS double
    DETERMINISTIC
BEGIN
	DECLARE lat1 double;
	DECLARE lon1 double;
	DECLARE lat2 double;
	DECLARE lon2 double;
	
	DECLARE R double;
	
	DECLARE f1 double;
	DECLARE f2 double;
	DECLARE df double;
	DECLARE dg double;
	
	DECLARE a double;
	DECLARE c double;
	DECLARE d double;
	SET lat1 = SPLIT_STRING($coord1,',',1);
	SET lon1 = SPLIT_STRING($coord1,',',2);
	SET lat2 = SPLIT_STRING($coord2,',',1);
	SET lon2 = SPLIT_STRING($coord2,',',2);
	SET R =  6371 * 0.62137;
	
	
	SET f1 = RADIANS(lat1);
	SET f2 = RADIANS(lat2);
	SET df = RADIANS(lat2-lat1);
	SET dg = RADIANS(lon2-lon1);
	
	
	SET a = SIN(df/2) * SIN(df/2) + COS(f1) * COS(f2) * SIN(dg/2) * SIN(dg/2);
        SET c = 2 * ATAN2(SQRT(a), SQRT(1-a));
	SET d = R * c;
            
	RETURN ROUND(d, 2);
    END */$$
DELIMITER ;

/* Function  structure for function  `SPLIT_STRING` */

/*!50003 DROP FUNCTION IF EXISTS `SPLIT_STRING` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`db_user`@`%` FUNCTION `SPLIT_STRING`( s VARCHAR(1024) , del CHAR(1) , i INT) RETURNS varchar(1024) CHARSET latin1
    DETERMINISTIC
BEGIN
        DECLARE n INT ;
        -- get max number of items
        SET n = LENGTH(s) - LENGTH(REPLACE(s, del, '')) + 1;
        IF i > n THEN
            RETURN NULL ;
        ELSE
            RETURN SUBSTRING_INDEX(SUBSTRING_INDEX(s, del, i) , del , -1 ) ;        
        END IF;
    END */$$
DELIMITER ;

/* Function  structure for function  `ViewCount` */

/*!50003 DROP FUNCTION IF EXISTS `ViewCount` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`db_user`@`%` FUNCTION `ViewCount`($dish_id BIGINT) RETURNS int(11)
    DETERMINISTIC
BEGIN
	DECLARE cnt INT;
	SET cnt = (SELECT COUNT(id) FROM tbl_treatment WHERE dish_id=$dish_id);
	RETURN cnt;
    END */$$
DELIMITER ;

